import React, { Component } from "react";
import Table from "../components/Table";

class AgentEdit extends Component {
  state = {
    i: "",
    a: "",
    t: ""
  };

  componentDidMount(props) {
    let i = this.props.location.state.id;
    let a = this.props.location.state.agent;
    let p = this.props.location.state.project;
    let t = this.props.location.state.type;
    this.setState({ i, a, t });
  }
  render() {
    const { i, a, t, p } = this.state;
    return (
      <div className="wrapper">
        <Table
          Head={a}
          Body={
            <div className="rowData  col-12" id={i}>
              <div className="col-2">
                <div>{i}</div>
              </div>
              <div className="col-2">
                <div>{p}</div>
              </div>
              <div className="col-2">
                <div>{a}</div>
              </div>
              <div className="col-2">
                <div>{t}</div>
              </div>
            </div>
          }
        />
        <p>
          {i}
          {a}
          {t}
        </p>
      </div>
    );
  }
}

export default AgentEdit;
